import React, { Component } from 'react';
import {CardBody,CardText} from 'reactstrap';
class Card extends Component{
        render (){
          
                
                return (

                       
                        <div className="card text-dark mb-3 mt-4 ml-3" style={{maxWidth: "50rem",backgroundColor:"#CE9FA1"}}>
                        <div className="card-content">
                                <div className="level">
                                <div className="level-left">
                                <div className="level-item">
                        <div className="card-body">
                         
                     <p className="card-text ">{this.props.notes}</p>
               
                        </div>
                      </div>
                      </div>
                      <div className="level-right">
                      <div className="level-item">
                     <button type="button" className="btn btn-danger" style={{float:"right"}}>Delete</button>
                 </div>
                 </div>
                 </div>
                 </div>
                 </div>
                );
        }
}
export default Card;
